import React, { useState } from 'react';
import './ProductDetail.css';

import { CoolMode } from "@/components/magicui/cool-mode";

import slider2 from '../src/images/sl1.webp';
import slider1 from '../src/images/sl2.webp';
import slider3 from '../src/images/sl3.webp';
import slider4 from '../src/images/sl4.webp';

const ProductDetail = () => {
  const [selectedImage, setSelectedImage] = useState(slider1); // Default image

  const images = [
    slider1,
    slider2,
    slider3,
    slider4
  ];

  const handleImageClick = (image) => {
    setSelectedImage(image);
  };

  return (
    <div className="product-detail-container">
      <div className="breadcrumb">
        <a href="/Home">Home</a> / <a href="/products"> Products </a> / CarityUI
      </div>

      <div className="product-detail-content">
        <div className="image-gallery" style={{display:'flex'}}>

          <div className="thumbnails"style={{margin:'30px'}}>
            {images.map((image, index) => (
              <img
                key={index}
                src={image}
                alt={`Thumbnail ${index + 1}`}
                onClick={() => handleImageClick(image)}
                className={selectedImage === image ? 'active' : ''}
              />
            ))}
          </div>

          <div className="main-image">
            <img src={selectedImage} alt="Selected" />
          </div>
        </div>


        <div className="product-info">
          <h1>Jenny’s Closets – The winter top for female, green</h1>
          <div className="reviews">
            <span>⭐⭐⭐⭐⭐</span>
            <span>157 Reviews</span>
          </div>
          <div className="price">
            <span className="current-price">$49</span>
            <span className="original-price">$99</span>
            <span className="discount">Save 50% right now</span>
          </div>
          <div className="features">
            <h4>Features</h4>
            <ul>
              <li>Made with full cotton</li>
              <li>Slim fit for any body</li>
              <li>Quality control by JC</li>
            </ul>
          </div>


          <div className="colors">
            <h4>Colors</h4>
            <div className="color-options">
              
              <button className="color green"></button>
              <button className="color orange"></button>
              <button className="color blue"></button>
              <button className="color black"></button>
            </div>

          </div>
          <div className="action-buttons">
            <CoolMode>
              <button className="add-to-cart">Buy Now</button>
            </CoolMode>

            <button className="add-to-cart">Add to cart</button>
            <button className="wishlist">
              <span>♡</span>
            </button>
          </div>
        </div>
      </div>
      <div className="product-tabs">
        <span>Description</span>
        <span className="active">Reviews 157</span>
        <span>Support</span>
      </div>
    </div>
  );
};

export default ProductDetail;
